import './App.css';

function Modal() {

  return (
    <div id="modal">
        <img src="/media/images/f1Logo.png" alt="F1 logo" id="logo"/>
        <p id="designedDeveloped">designed and developed by </p>
        <p id="teamDRS">Team DRS</p>
    </div>
  );
}

export default Modal;
